import React from "react";
import "./Mainfront.css";
import pg1 from "./ICONS/1.png";
import pg2 from "./ICONS/2.png";
import pg3 from "./ICONS/3.png";
import pg4 from "./ICONS/4.png";
import pg5 from "./ICONS/5.png";
import Tilt from 'react-parallax-tilt';

const Mainfront = () => {
  return (
    <section id="hero" className="centrado">
      <div className="container  ">
        <h1 className="f1 red" style={{ color: "#272341" }}>
          Hi! I'm <span className="nalo-words">Xavier Arce</span>
          <br />
          Full Stack Web Developer
          <br />
          Crafting Digital Experiences
        </h1>
        <div className="skills" >
                    <Tilt className="icons" tiltMaxAngleX={25} tiltMaxAngleY={25}>
                      <img
                        alt="Project-img"
                        className=""
                        src={pg1}
                        height={75}
                      />
                    </Tilt>
                    <Tilt className="icons" tiltMaxAngleX={25} tiltMaxAngleY={25}>
                      <img
                        alt="Project-img"
                        className=""
                        src={pg2}
                        height={75}
                      />
                    </Tilt>
                    <Tilt className="icons" tiltMaxAngleX={25} tiltMaxAngleY={25}>
                      <img
                        alt="Project-img"
                        className=""
                        src={pg3}
                        height={75}
                      />
                    </Tilt>
                    <Tilt className="icons" tiltMaxAngleX={25} tiltMaxAngleY={25}>
                      <img
                        alt="Project-img"
                        className=""
                        src={pg4}
                        height={75}
                      />
                    </Tilt>
                    <Tilt className="icons" tiltMaxAngleX={25} tiltMaxAngleY={25}>
                      <img
                        alt="Project-img"
                        className=""
                        src={pg5}
                        height={75}
                      />
                    </Tilt>
        </div>
        <p className="f3 grow">
          <a
            rel="noreferrer"
            className="f3 b shadow-3 pa3 gorw nalo-words"
            href="#about"
          >
            Get to know me
          </a>
        </p>
      </div>
    </section>
  );
};

export default Mainfront;
